import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the main search input to be visible and enter "travel"
    await page.waitForSelector('#mainSearchInput');
    await page.fill('#mainSearchInput', 'travel');

    // Wait for the search results dropdown to appear
    await page.waitForSelector('.search-results', { state: 'visible' });

    // Take screenshot after entering the search term
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_results.png'));

    return {
      success: true,
      action: "Entered 'travel' in the main search input and verified search dropdown appears",
      extractedData: {},
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

